import React from "react";

import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav>
  <Link to="/shop">Shop</Link>
  <Link to="/sell">Sell</Link>
  <Link to="/cart">Cart</Link>
  <Link to="/wishlist">Wishlist</Link>
</nav>
  );
};

export default Navbar;
